import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./App.css";

import { useNavigate } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Nav>
          <Routes>
            <Route path="/" element={<Dashboard />} />
          </Routes>
        </Nav>
      </Router>
    </div>
  );
}

export default App;
